არ გამოიყენება გამოყენების შემდეგ სცენარებზე: 
1. მაღალი წნევის მყვინთავის აქტივობები, როგორიცაა სკუბა დაივინგი; 
2. მაღალი ტემპერატურისა და მაღალი ტენიანობის გარემოში განხორციელებული აქტივობები, როგორიცაა ცხელი შხაპი, ცხელი წყაროები, საუნები (ორთქლის ოთახები) და ა.შ.; 
3. აქტივობები, რომლებიც ტარდება წყლის მაღალი წნევის ან მაღალი სიჩქარით წყლის ნაკადის პირობებში, როგორიცაა დაივინგი, მოტორიზებული წყლის სპორტი, მანქანის რეცხვა და ა.შ.

გამონაკლისი შემთხვევები:
1. თუ გრძელვადიანი მენსტრუალური ციკლი ქალებისთვის დაახლოებით 28 დღეა, შეგიძლიათ მიმართოთ ამ აპლიკაციას;
2. ქალები, რომელთა მენსტრუალური ციკლი ძალიან მოკლე ან ძალიან გრძელია, არ გამოიყენება ამ აპისთვის;
3. სხვადასხვა მიზეზი გამოიწვევს უსაფრთხოების პერიოდის შეცვლას, ამიტომ ეს აპი მხოლოდ საცნობაროა და არა როგორც ეფექტური კონტრაცეპტივი.

1. მოხუცები (65 წელზე მეტი), ორსული ქალები;
2. დიაბეტით ან სხვა მეტაბოლური დაავადებებით დაავადებული პაციენტები;
3. გულ-სისხლძარღვთა დაავადებები;
4. ფილტვის დაავადებათა პოპულაცია;
5. ძვლებისა და სახსრების დაავადებები და ექიმის რჩევები არ არის შესაფერისი მათთვის, ვინც ვარჯიშობს
